"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10023194\">",
"      What are some side effects of this drug?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10023196\">",
"      What are some side effects that I need to call my doctor about right away?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10023191\">",
"      How is this drug best taken?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10023192\">",
"      What do I do if I miss a dose?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10023197\">",
"      How do I store and/or throw out this drug?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10023198\">",
"      General drug facts",
"     </a>",
"    </li>",
"   </ul>",
"  </div>",
"  <h1>",
"   RELATED TOPICS",
"  </h1>",
"  <div id=\"relatedTopics\">",
"   <ul>",
"    <li class=\"plainItem\">",
"     <a class=\"drug drug_general\" href=\"UTD.htm?30/63/31734?source=related_link\">",
